import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className="home-page">
      <h1>Конфигуратор ПК на заказ</h1>
      <p>Создайте свой идеальный персональный компьютер с нашей помощью!</p>
      <Link to="/configurator" className="start-button">Начать сборку ПК</Link>
    </div>
  );
};

export default HomePage;
